import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css';
import data from './Sdata';


ReactDOM.render(

  <>

    <h1 className="heading_style"> List of top 5 Netflix Series in 2021 </h1>

  <Card 
  imgsrc = {Sdata[0].imgsrc}
  title= {Sdata[0].title} 
  sname= {Sdata[0].sname}
  link= {Sdata[0].link} 
  />

  <Card 
  imgsrc = "https://wallpapercave.com/wp/wp4056410.jpg" 
  title= "A Netflix Original Series" 
  sname= "DARK" 
  link= "https://www.netflix.com/search?q=DARK&jbv=80100172" />

  <Card 
  imgsrc = "https://lh3.googleusercontent.com/proxy/OcImaN25NuZw66klemRTPKR1iWkFyUXOtz4bxdnZRL4umLHspCX3Tz_02FryhKPcQW2J1yWp0XRE4r9LgQLfQQmfAGn_bh2Mh62YjmN1qJpy5nQUew" 
  title= "A Netflix Original Series" 
  sname= "Sons of Anarchy" 
  link= "https://www.netflix.com/search?q=sons&jbv=70143844" />

  <Card 
  imgsrc = "https://www.mansworldindia.com/wp-content/uploads/2018/12/Untitled-design-55.jpg" 
  title= "A Netflix Original Series" 
  sname= "F.R.I.E.N.D.S" 
  link= "https://www.netflix.com/title/70153404" />
  </>,
document.getElementById('root')
);
